(416, '1', '416', 'Enhancement', 'High', 'FE: Customer order (supplier list)', '(Confirm supplier assignments) Confirming button should not be another check mark, maybe print confirm PO. There should be a function to confirm all, only if all listed suppliers meet the minimums. If not, it should alert that the minimums are not met.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n29-10-2014--Admin Dba changed status to Ready for test', '-1'),
(418, '1', '418', 'Enhancement', 'High', 'FE: Create order (supplier list)', '(Confirm supplier assignments) Unchecking a supplier should spawn an action (If only one order is generated, a confirmation to delete the order).', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n12-11-2014--Admin Dba changed status to Ready for test', '-1'),
(419, '1', '419', 'Enhancement', 'High', 'FE: Create order (supplier list)', '(Confirm supplier assignments) Unchecking a supplier should spawn an action (If only one order is generated, a confirmation to delete the order).', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n12-11-2014--Admin Dba changed status to Ready for test', '-1'),
(420, '4', '420', 'Enhancement', 'High', 'FE: Create order (supplier list)', '(Confirm supplier assignments) Delivery day and date should be displayed (day abbreviations: M-Tu-W-Th-F-Sa-Su). Currently only the date is displayed.', 'a', 'Closed', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test\r\n08-11-2014--James  Closed the issue', '11/08/2014'),
(421, '4', '421', 'Enhancement', 'High', 'FE: Create order (supplier list)', '(Confirm supplier assignments) Delivery day and date should be displayed (day abbreviations: M-Tu-W-Th-F-Sa-Su). Currently only the date is displayed.', 'a', 'Closed', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test\r\n08-11-2014--James  Closed the issue', '11/08/2014'),
(424, '1', '424', 'Defect', 'High', 'FE: Create order (supplier list)', '(Confirm order) Although default qty is 3 digits, edits are not allowing more than 2 digits. The qty field should allow for 3 digits. Listed suppliers should expand to items in PO able to edit ability by item.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test', '-1'),
(426, '1', '426', 'Defect', 'High', 'FE: Create order (supplier list)', '(Confirm order) When an item is deleted or edited, the $ amount should adjust but instead it does not change.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test', '-1'),
(427, '1', '427', 'Defect', 'High', 'FE: Create order (supplier list)', '(Confirm order) When an item is deleted or edited, the $ amount should adjust. If the amount then falls below minimum rules, a warning that changing to the new qty will lower the total $ below minimum requirements should appear.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test', '-1'),
(429, '4', '429', 'Defect', 'High', 'FE: Create order (order list)', 'After confirming aggregated PO''s, they should appear on the order list page displayed as: 1. Most Recent, 2. Supplier, and 3. Alphabetical. The new order currently does not display. It''s important to show order number as well.', 'a', 'Closed', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n29-10-2014--Admin Dba changed status to Ready for test\r\n08-11-2014--James  Closed the issue', '11/08/2014'),
(430, '4', '430', 'Defect', 'High', 'FE: Create order (order list)', 'After confirming aggregated PO''s, they should appear on the order list page displayed as: 1. Most Recent, 2. Supplier, and 3. Alphabetical. The new order currently does not display. It''s important to show order number as well.', 'a', 'Closed', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test\r\n08-11-2014--James  Closed the issue', '11/08/2014'),
(431, '1', '431', 'Defect', 'High', 'FE: Create order (PO/supplier confirm)', 'An item shouldn''t ever not have an assigned supplier. And certainly no confirmation without accounting for an unassigned item. Items often appear without a supplier and do not allow order confirmations without accounting for that item in any way.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n12-11-2014--Admin Dba changed status to Ready for test', '-1'),
(432, '4', '432', 'Defect', 'High', 'FE: Create order (PO/supplier confirm)', 'An item shouldn''t ever not have an assigned supplier. And certainly no confirmation without accounting for an unassigned item. Items often appear without a supplier and do not allow order confirmations without accounting for that item in any way.', 'a', 'Closed', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n07-11-2014--Admin Dba changed status to Ready for test\r\n08-11-2014--James  Closed the issue', '11/08/2014'),
(433, '1', '433', 'Enhancement', 'High', 'FE: Create order (PO/supplier confirm)', 'Edits to items on confirmation page should change minimum status when updated $ has effect.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n29-10-2014--Admin Dba changed status to Ready for test', '-1'),
