(435, '1', '435', 'Enhancement', 'High', 'FE: Create order (PO/supplier confirm)', 'There is no need for the save function on this page. There should be a display at the top with a summary of all the PO''s (Tot/pcs, Tot$, Tot Del). Currently only PO line items displayed. Reference doc: DBA Functional Specifications v1 2 - 9/23/14', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n29-10-2014--Admin Dba changed status to Ready for test', '-1'),
(436, '1', '436', 'Enhancement', 'High', 'FE: Create order (PO/supplier confirm)', 'There is no need for the save function on this page. There should be a display at the top with a summary of all the PO''s (Tot/pcs, Tot$, Tot Del). Currently only PO line items displayed. Reference doc: DBA Functional Specifications v1 2 - 9/23/14', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n29-10-2014--Admin Dba changed status to Ready for test', '-1'),
(437, '1', '437', 'Enhancement', 'High', 'FE: Create order (PO/supplier confirm)', 'When order is unchecked, the items should aggregate into the remaining order. Confirmation to move items ordered to remaining PO''s should result in this hierarchy rule set: first suppliers not meeting minimum requirements, then by customer preference.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test', '-1'),
(438, '1', '438', 'Enhancement', 'High', 'FE: Create order (PO/supplier confirm)', 'When order is unchecked, the items should aggregate into the remaining order. Confirmation to move items ordered to remaining PO''s should result in this hierarchy rule set: first suppliers not meeting minimum requirements, then by customer preference.', 'a', 'Ready for test', '', '0000-00-00 00:00:00', 'James ', 4, 'Gundeep Singh', '\r\n28-10-2014--Admin Dba changed status to Ready for test', '-1'),
